script: |
  super -f text -I q5192.spq | sort > q5192.out

inputs:
  - name: q5192.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE + col2 NOT IN ( col2 + + col1 * col2 + + 42 * ( 91 ) );
  - name: tab1

outputs:
  - name: q5192.out
    data: |
      51	14	96
      85	5	59
      91	47	68
